description:
Danielle is feeling flirty and decides to take things into her own hands in the bedroom. Since Isiah can't resist beautiful blondes, he's quick to take the hint and rise to the occasion. A simple paper airplane message leads to a playful romp on this hot summer day. Maybe you'll opt to stay indoors and have some fun for yourself too?

